import React, { useState } from 'react';
import './App.css';
import {Task} from '../components/Task' 

function App() {
  const [Tasks,setTasks]=useState({
    id :'1' ,
    text : 'studing js',
    reminder : 'true',
},
{
    id :'2' ,
    text : 'studing js',
    reminder : 'false',
},
{
    id :'3' ,
    text : 'studing js',
    reminder : 'true',
})
  return (
    <>
      <Task key={Tasks.id} task={Tasks}/>
    </>
  );
}

export default App;
